import Nickname from "./Nickname";

const MainPage = ({ nickname, setNickname }) => {
  return (
    <div>
      <div className="grid h-screen place-items-center">
        <h1>Movie Poll</h1>
        <Nickname
          onPickNickname={(nickname) => {
            setNickname(nickname);
          }}
          nickname={nickname}
        />
      </div>
    </div>
  );
};

export default MainPage;
